        {'Video is not implemented by GiftedChat.'}
      </Text>
      <Text style={{ color: Color.alizarin, fontWeight: '600' }}>
        {
          'You need to provide your own implementation by using renderMessageVideo'
        }
        {'prop.'}
      </Text>
    </View>
  )
}
